      SELECT DISTINCT - col2 * col2 - + 1 AS col2, ( - 4 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q5338.out
    data: |
      -3482	-4
      -4625	-4
      -9217	-4
